      "id": "6205682e4659380b25829e18",
      "title": "Os artefatos são vistos (na maioria das vezes) através de perspectivas predeterminadas culturalmente, o que pode ocasionar “hierarquias do modo de ver”. O usuário tem poder de ressignificação contínua do objeto e um sistema modular é constituído através da possibilidade de uso não determinada e com um sistema de operação que pode ser próprio do usuário e da sua necessidade. A transitoriedade dos espaços habitacionais abrem hipóteses sobre uma variedade de diferentes composições de objetos relacionada diretamente com o uso que se dar o espaço, através da alteração de personas que vivenciam o lugar, ou das atividades desenvolvidas.\n",
