          "id": "620591ddd1f85a10584b14cd",
          "title": "lista de compras compartilhada, onde você tem pré cadastrados vários itens de supermercado, agrupados por categoria (e podendo inserir novos itens em categorias). Quando alguém vai às compras, pode clicar num botão de \"última chamada para inserir um item\" e pode, ao escolher os produtos e colocar no carrinho (físico ou virtual), ir removendo os itens. Ao concluir a compra, pode também clicar num botão para que os demais saibam o que não foi comprado. Pela frequência de compra de itens, poderia haver a sugestão de que algo está perto de acabar, para avaliar se entra ou não na lista. Aí começa a parte não implementável pela minha pessoa (hahaha): algo pegaria a lista de compras e consultaria os preços no Rappi (p.ex), identificando o mercado onde a compra sairia mais barata (incluindo tx de serviço, frete e gorjeta), inclusive a combinação de compras em mercados diferentes que faria com que a compra total ficasse com um valor mais vantajoso. ",
