          "title": "A pandemia desencadeou estresse, ansiedade e outros sentimentos que afetam a saúde mental das pessoas. A terapia se tornou um grande desejo, mas uma parte da população não tem condições financeiras para esse acompanhamento. Existe profissionais voluntários para esse tipo de acompanhamento, mas pouco divulgado. Existe uma falha na comunicação entre pessoas necessitadas e os profissionais dispostos",
