          "id": "620579d74659380b25829e21",
          "title": "Alguns ingredientes são tidos como \"básicos\", ou seja, compram-se para diversas receitas em comum (como o caso da cebola, limão, tomate, arroz, macarrão, e por aí vai). Em toda feira há os produtos que acabam terminando antes do período da próxima feira chegar. É comum chegar no fim da feira e possuir cada vez menos ingredientes que combinados tragam receitas diferentes, e a criatividade é posta em prova. A ideia é que receitas práticas e com poucos ingredientes sejam as principais sugestões, com dicas e outras formas de usar os mesmos ingredientes. Há equivalências, tanto nutricionais, quanto de sabores, entre tais produtos e a intenção é que tenha esse compilado na palma da mão.",
