          "id": "620584184659380b25829e26",
          "title": "A grande maioria das pessoas não gosta de fazer lista de compras e reclamam de não ter uma lista base para selecionar os itens que está precisando, agrupadas pelas seções de supermercado para facilitar a compra. Muitas pessoas que dividem a responsabilidade pelas compras, comentam que gostariam de saber exatamente quando a outra pessoa está indo fazer a feira para que possa checar se tem algum item faltando e aproveitar a oportunidade.\nQuem faz compra online, muitas vezes olha onde está o menor preço do seu item supostamente mais caro e desiste de pesquisar nos outros supermercados por conta do tempo despendido na atividade. Outros escolhem o supermercado que comumente tem seus itens ou que julga ser o mais barato e realiza suas compras nele [e não quer nem procurar mais preço de nada para não ver que pagou caro demais por algo que comprou rsrs].\nDepois do trabalho de fazer a feira virtual, ninguém para para reparar se a taxa de serviço foi cara, não refaria tudo \"nem a pau\".",
