      "title": "durante a pandemia muitas pessoas encontraram no cultivo de plantas uma saída para minorar a falta de vida social e contato com a natureza. incluir o cuidado com plantas na rotina para muitos foi motivo de alívio e um passatempo que acabou tornando-se uma atividade terapêutica.\no hábito de trocar mudas entre amigos, ou mesmo até de fazer pequenos “furtos verdes” pelas ruas acabou incorporando-se também a rotina de adeptos antigos ou “recém convertidos”.\na prática da doação ou troca de mudas já existe em alguns fóruns de redes sociais, sites e grupos de whatsapp - onde há também venda. não encontrei nenhum aplicativo que funcionasse apenas como um mediador de doações e trocas de plantas e sementes entre pessoas - há entretanto outros tantos que identificam espécies, indicam usos e formas de cultivo.",
