          "title": "Com o reforço do trabalho remoto e digital, as pessoas passaram a ter que cada vez mais se autogerenciar e isso levou a termos que estabelecer novas estratégias para isso. Não basta ter uma miríade de ferramentas de TODO List, precisamos de uma estratpegia para ajudar no uso de tais ferramentas. E ferramentas cenradas em estratpegia auxiliam pelo fato de que as BIIG DECISIONS já estão estruturadas por meio da implementação algoritmica da estratpegia.",
