          "title": "Os eleitores têm valores diferentes e, portanto, dão diferentes importâncias aos dados que podem ser compilados na ferramenta. É necessário compreender esses valores, compreender essas personas, para que a ferramenta abrace estratégias 'democráticas' / que atendam bem as necessidades do público. A solução precisa imprimir segurança no público e para isso é preciso que seja transparente, com fontes explícitas. Talvez seja interessante permitir a interação entre os usuários, para que possam responder suas dúvidas de forma orgânica, mas é preciso atentar para que a essa interação (que não é auditável) esteja à parte / não componha o quadro de infos 'oficiais' de cada candidato. ",
