          "title": "Uma ferramenta de estudos que, a partir de alguns parâmetros, cria um plano adaptado às necessidades de quem deseja aprender algo novo. Ela sugere etapas, tempo de dedicação, formas de exercitar e autoavaliações para testar o aprendizado esperado. A partir dela, você pode compartilhar o conhecimento adquirido com amigos via WhatsApp, pedindo feedback sobre a clareza da explicação (exercitar o ensinar é a melhor forma de aprender). A ferramenta também pode sugerir conexão com pessoas que estejam aprendendo sobre temas semelhantes.",
