          "id": "620591d0d1f85a10584b14cc",
          "title": "uma ferramenta com as categorias de obrigação do usuário e uma forma de visualizar quão quente ou quão frias estão as atividades: se faz muito tempo que o usuário não completa uma tarefa de uma categoria, essa categoria fica fria. se o usuário fez tarefas recentes, a categoria fica quente. a interface é simples, não precisa definir a granularidade da ToDo, mas um contador. assim que o usuário termina uma tarefa da categoria A, ele aperta o botão da categoria A. o sistema contabiliza e faz relatórios por dia.",
